%[text] ## **Stereo PIV processing (PIVlab issue** 139)
%[text] This script is designed to develop and test code required to introduce stereo PIV processing capabilities into PIVlab.
%%
%[text] ### Import Data
%[text] First we need data. The data used herehas been provided by William Thieke.
data_dir = ".." + filesep + ".." + filesep + "data_from_william" + filesep + "stereo" + filesep;
cameras = ["camera_1", "camera_2"];
%[text] We start by importing the calibration data. The calibration target consists of a 7x10 Charuco grid pattern .
image_data = struct();
ext = "bmp";
for camera = cameras
    directory = data_dir + camera + "_calibration_imgs";
    [images, file_names] = import_images(directory, ext);
    image_data.calibration.(camera).images = images;
    image_data.calibration.(camera).files = file_names;
    directory = data_dir + "PIV_imgs_move_closer" + filesep + camera;
    [images, file_names] = import_images(directory, ext);
    image_data.test1.(camera).images = images;
    image_data.test1.(camera).files = file_names;
    directory = data_dir + "PIV_imgs_move_up" + filesep + camera;
    [images, file_names] = import_images(directory, ext);
    image_data.test2.(camera).images = images;
    image_data.test2.(camera).files = file_names;
end
%[text] We can also import the test data
%%
%[text] ### Camera corrections
%[text] To correct for camera based image distortion we use calibration images of a charuco pattern calibration target to obtain an estimate of the camera parameters:
pattern_type = "charuco-board";
pattern_dims = [7 10];
pattern_name = "DICT_5X5_100";
checker_size = 8.8;  % 100 pixels / 300 pixels-per-inch * 26.4 mm-per-inch)
marker_size = 0.75 * checker_size;
image_size = [1200 1920];

worldPoints = patternWorldPoints(pattern_type, pattern_dims, checker_size);

parameters = struct();
for camera = cameras
    imagePoints = detectCharucoBoardPoints(image_data.calibration.(camera).files, pattern_dims, pattern_name,checker_size, marker_size);
    parameters.(camera) = estimateCameraParameters(imagePoints, worldPoints, ImageSize=image_size);
end
%[text] We can also use estimateCameraParameters in stereo to provide data about the relative location of the cameras:
stereo_image_points = detectCharucoBoardPoints(image_data.calibration.camera_1.files, image_data.calibration.camera_2.files,pattern_dims, pattern_name,checker_size, marker_size);
stereo_parameters = estimateCameraParameters(stereo_image_points, worldPoints, ImageSize=image_size);
%%
%[text] We can use the camera paramters to correct the images in the dataset.
datasets = fieldnames(image_data);
for indx = 1:length(datasets)
    for camera = cameras
        images = image_data.(datasets{indx}).(camera).images;
        for jndx = 1:length(images)
            images{jndx} = undistortImage(images{jndx}, parameters.(camera));
        end
        image_data.(datasets{indx}).(camera).images = images;
    end   
end
%%
%[text] The triangulate object can then be used to triangulate common points (e.g. the charuco grid)
board_positions = triangulate(stereo_image_points(:,:,1,1), stereo_image_points(:,:,1,2), stereo_parameters) %[output:14b86180]
%[text] 
%%
%[text] Now we can find the 3-D coordinates of common points in images from the two cameras. The next step is to find the particles in images from both cameras. In real data the particles will lie in a flat light field that has some small thickness. To assist in finding particle pairs we need to be able to map a particle position in the image from one camera on to the image on the other camera. 
%[text] We can start by making the assumtion that the laser light field is infinetly thin. We then know that the triangulated positions of particles must lie in the this plane. However, we do not now the position of the plane or its normal vector only that a valid trianglation of particle pairs must result in positions that lie in a 2-D plane. This requires some least squares fitting using data from multiple image pairs until the error meets some minimum.
image1 = image_data.test1.camera_1.images{1};
image1 = imadjust(imflatfield(image1, 50)) < 128;
c1 = imfindcircles(image1, [2 10]); %[output:75f91dbb]
fig1 = figure(1) %[output:8e8c0220] %[output:88786704]
imshow(image1) %[output:88786704]
hold on %[output:88786704]
scatter(c1(:,1), c1(:,2), LineWidth=3) %[output:88786704]
hold off %[output:88786704]

image2 = image_data.test1.camera_2.images{1};
image2 = imadjust(imflatfield(image2, 50)) < 128;
c2 = imfindcircles(image2, [2 10]); %[output:684f18c1]
fig2 = figure(2); %[output:8afa986f]
imshow(image2) %[output:8afa986f]
hold on %[output:8afa986f]
scatter(c2(:,1), c2(:,2), LineWidth=3) %[output:8afa986f]
hold off %[output:8afa986f]

pdm = [c1, ones(size(c1,1),1)] * stereo_parameters.FundamentalMatrix * [c2'; ones(1, size(c2,1))];
[v, indx] = min(abs(pdm), [], 1);
is_low = v < 0.3;
c1_isin_c2 = c1(indx(is_low),:);
p = triangulate(c1_isin_c2, c2(is_low,:), stereo_parameters);
%[text] dfg
%%
%[text] We need to find the plane of the light sheet in the image. The assumption is that it is not coplaner with calibration pattern. For this example we use the calibration pattern as we know it is a 2D plane present in both images. Object detection is applied to the images using a Laplacian of Gaussians filter first to highlight edges. The filtered images are thresholded using a range of different thresholds. The binary images are pased to the imaging toolbox connected component feature detector. The features are then reduced to a selection based on feature area and reduced further to remove overlapping bounding boxs. The centroids of the resulting set of features can then be used to determ the location and normal of the light plane.
%%
% image1 = image_data.calibration.camera_1.images{1};
%image2 = image_data.calibration.camera_2.images{1};
dummy_images = "C:\Users\mat.tolladay\Documents\mathworks\dummy_data";
image1 = imread(dummy_images + filesep + "smoke"); %[output:5456d437]
kernel_size = 2;
c1 = detect_blobs(image1, kernel_size);
c2 = detect_blobs(image2, kernel_size);

pdm = [c2, ones(size(c2,1), 1)] * stereo_parameters.FundamentalMatrix * [c1, ones(size(c1,1), 1)]';
[v, indx] = min(abs(pdm), [], 1);
is_low = v < 0.35;
c2_isin_c1 = c2(indx(is_low),:);
p = triangulate(c2_isin_c1, c1(is_low,:), stereo_parameters);

f1 = figure(1)
imshow(image1)
hold on
scatter(c1(:,1), c1(:,2), [], "green", "filled")
scatter(c1(is_low,1), c1(is_low,2), 10, "red", "filled")
hold off

f2 = figure(2)
imshow(image2)
hold on
scatter(c2(:,1), c2(:,2), [], "green", "filled")
scatter(c2_isin_c1(:,1), c2_isin_c1(:,2), 10, "red", "filled")
hold off

